graphql.query:
mutation ($payload:ToolsCreateWebhookLogInput!)
{
	toolsCreateWebhookLog (payload:$payload)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
	}
}

query ($query:QueryStatement $constraint:QueryStatement)
{
	toolsPaginateWebhookLogs (query:$query constraint:$constraint)
	{
		total
		count
		rows
	}
}

query ($query:QueryStatement)
{
	toolsGetWebhookLogs (query: $query)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

query ($query:QueryStatement)
{
	toolsFindWebhookLog (query: $query)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

query ($id:ID)
{
	toolsFindWebhookLogById (id:$id)
	{
		id
		rowId
		url
		headerRequest
		bodyRequest
		createdAt
		updatedAt
	}
}

mutation ($payload:ToolsUpdateWebhookLogInput!)
{
	toolsUpdateWebhookLog (payload:$payload)
	{
		id
